  var transpose = function (A) {
    let result = [];
    for (let i = 0, l = A[0].length; i < l; i++) {
      let re = [];
      for (let ii = 0, ll = A.length; ii < ll; ii++) {
        re.push(A[ii][i]);
      }
      result.push(re);
    }
    return result;
  };
